"use strict";function onGoogleLogin(n){let t=n.getBasicProfile();axios.get("RegisterGoogleUser?name="+t.getName()+"&email="+t.getEmail()).then(function(n){n.data==="Success"&&($("#googleLoginStatus").show(),setTimeout(function(){window.location.href="/Dashboard"},2e3))}).catch(function(){})}function onGoogleFailure(){}function showGoogleLogin(){gapi.signin2.render("google-signin",{scope:"profile email",width:240,height:50,longtitle:!0,theme:"dark",onsuccess:onGoogleLogin,onfailure:onGoogleFailure})}